import { useState } from 'react';
import './Admin.css';

function Admin() {
  const [productData, setProductData] = useState({
    name: '',
    description: '',
    dimensions: '',
    price: '',
    style: '',
    image: null
  });
  const [message, setMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    try {
      const formData = new FormData();
      
      formData.append('name', productData.name);
      formData.append('description', productData.description);
      formData.append('dimensions', productData.dimensions);
      formData.append('price', productData.price);
      formData.append('style', productData.style);
      
      if (productData.image) {
        formData.append('image', productData.image);
      }

      for (let pair of formData.entries()) {
        console.log(pair[0] + ': ' + pair[1]);
      }

      const response = await fetch('http://localhost/backend/api/add_product.php', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      
      if (data.success) {
        setMessage('Product added successfully!');
        setProductData({
          name: '',
          description: '',
          dimensions: '',
          price: '',
          style: '',
          image: null
        });
      } else {
        setMessage('Error: ' + (data.error || 'Unknown error'));
      }
    } catch (error) {
      setMessage('Error: ' + error.message);
      console.error('Full error:', error);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProductData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    setProductData(prev => ({
      ...prev,
      image: file
    }));
  };

  return (
    <div className="admin-container">
      <h1>Admin Dashboard</h1>
      <form onSubmit={handleSubmit} className="admin-form">
        <div className="form-group">
          <label>Product Name</label>
          <input
            type="text"
            name="name"
            value={productData.name}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Description</label>
          <textarea
            name="description"
            value={productData.description}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Dimensions</label>
          <input
            type="text"
            name="dimensions"
            value={productData.dimensions}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Price</label>
          <input
            type="number"
            name="price"
            step="0.01"
            value={productData.price}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Style</label>
          <select name="style" value={productData.style} onChange={handleChange} required>
            <option value="">Select style</option>
            <option value="Matte">Matte</option>
            <option value="Glossy">Glossy</option>
            <option value="Holographic">Holographic</option>
          </select>
        </div>
        <div className="form-group">
          <label>Image</label>
          <input
            type="file"
            accept="image/*"
            onChange={handleImageChange}
            required
          />
        </div>
        <button type="submit" className="submit-button">
          Add Product
        </button>
      </form>
      {message && <p className="message">{message}</p>}
    </div>
  );
}

export default Admin;
